import Buttons from "./Buttons";

function gameStatus() {
    ans_letters.size !== 0 && right.size >= ans_letters.size ? (
        <h1>You Win!</h1>
    ) : mistake >= maxWrong ? (
        <h1>You Lose!</h1>
    ) : answer != "" ? (
        <Buttons
            right={right}
            updateRight={setRight}
            wrong={wrong}
            updateWrong={setWrong}
            mistake={mistake}
            updateMistake={setMistake}
        />
    ) : (
        <p></p>
    )
}

export default gameStatus;
